import React, { useState } from 'react';
import './App.css';
import { BrowserRouter, Route, Switch } from 'react-router-dom';
import Dashboard from './components/Dashboard/Dashboard';
import Market from './components/Market/Market';
import Login from './components/Login/Login';
import { AppContext } from './context/ContextLib'
import Delaer from './components/Login/Dealer';
function App() {
  const [token, setToken] = useState();
  const [userType, setUserType] = useState();
  console.log(token);


  return (
    <AppContext.Provider value={{ token, setToken }}>
      <BrowserRouter>
        <Switch>
          {token ?
            userType == 'Dealer' ?
              <Dashboard token={token} /> :
              userType == 'User' ?
                <Market /> :
                <Login />
            :
            <Login />
          }

        </Switch>
      </BrowserRouter>
    </AppContext.Provider>
  );







  if (!token) {
    return (


      <BrowserRouter>
        <Switch>
          <Route path="/login"  >
            <Login setToken={setToken} setUserType={setUserType} />
          </Route>
          <Route path="/dealer">
            <Delaer setToken={setToken} setUserType={setUserType} />
          </Route>
        </Switch>
      </BrowserRouter>)
  }

  if (userType === 'Dealer') {
    return (
      <AppContext.Provider value={{ token, setToken }}>
        <div className="wrapper">
          <BrowserRouter>
            <Switch>
              <Route path="/dealer" >
                <Dashboard token={token} />
              </Route>
            </Switch>
          </BrowserRouter>
        </div>
      </AppContext.Provider>
    );
  }

  console.log(token);
  return (<BrowserRouter>
    <Switch>
      <Route path="/login/market">
        <Market />
      </Route>

    </Switch>
  </BrowserRouter>)
}


export default App;
